export var ActionTriggerAppearance;
(function (ActionTriggerAppearance) {
    ActionTriggerAppearance["justified"] = "justified";
    ActionTriggerAppearance["lightweight"] = "lightweight";
    ActionTriggerAppearance["outline"] = "outline";
    ActionTriggerAppearance["primary"] = "primary";
    ActionTriggerAppearance["stealth"] = "stealth";
})(ActionTriggerAppearance || (ActionTriggerAppearance = {}));
